import React from 'react';
import './style.css';

const Cards = ({data}) => {
  console.log(data)
  return <> 
  <div className="cards">
    {data.cards.map( card => {
      const {title, anchorUrl, anchorText, image, description} = card
      return <div className='card'>

        <img alt='image' src={image} />
        <div className='card-text'>
        <h2>{title}</h2>
        <p>{description}</p>
        </div>
        <a href={anchorUrl}>{anchorText}</a>

        </div>
    })}
    </div>
  </>
}

export default Cards;
